import React, { useState } from 'react';
import axios from 'axios';
import { useNavigate, Link } from 'react-router-dom';
import { EnvelopeIcon, LockClosedIcon } from '@heroicons/react/24/outline';
import './Login.css';

export default function Login({ setIsAuth }) {
  const [username, setUsername] = useState('');
  const [password, setPassword] = useState('');
  const [msg, setMsg] = useState('');
  const navigate = useNavigate();

  const handleLogin = async (e) => {
    e.preventDefault();
    try {
      const res = await axios.post('http://localhost:5000/api/login', { username, password });
      console.log('Login response:', res.data);
      localStorage.setItem('token', res.data.token);
      setIsAuth(true);
      navigate('/home');
    } catch (err) {
      setMsg(err.response?.data?.message || 'Error');
    }
  };

  return (
    <div className="login-page">
      <div className="login-left">
        <div className="login-content">
          <h1 className="welcome-message">Welcome Back</h1>


            <div className="form-group">
              <div className="input-with-icon">
                <EnvelopeIcon className="input-icon" />
                <input 
                  id="email"
                  type="email" 
                  placeholder="     Email" 
                  value={username} 
                  onChange={e => setUsername(e.target.value)} 
                  required 
                />
              </div>
            </div>

            <div className="form-group">
              <div className="input-with-icon">
                <LockClosedIcon className="input-icon" />
                <input 
                  id="password"
                  type="password" 
                  placeholder="     Password" 
                  value={password} 
                  onChange={e => setPassword(e.target.value)} 
                  required 
                />
              </div>
            </div>

            <Link to="/resetPassword" className="forgot-password">
              Forgot Password?
            </Link>

            <button type="submit" className="login-btn" onClick={handleLogin}>Log in</button>


          <div className="signup-link">
            Don't Have an Account? <Link to="/register">Sign up</Link>
          </div>

          {msg && <div className="error-message">{msg}</div>}
        </div>
      </div>

      <div className="login-right">
        <div className="image-container">
          <div className="main-image">
            <img src="./src/images/sitting-2.png" alt="Girl sitting" />
          </div>
          <div className="floating-images">
            <div className="floating-image image-1">
              <img src="./src/images/download.png" alt="Feature 1" />
            </div>
            <div className="floating-image image-2">
              <img src="/src/images/11.png" alt="Feature 2" />
            </div>
            <div className="floating-image image-3">
              <img src="/src/images/Avatar Group.png" alt="Feature 3" />
            </div>
            <div className="floating-image image-4">
              <img src="/src/images/profile.jfif" alt="Feature 4" />
            </div>
          </div>
          <svg className="connecting-lines" viewBox="0 0 400 400" preserveAspectRatio="none">
            <line x1="200" y1="200" x2="100" y2="100" stroke="#3b82f6" strokeWidth="2" />
            <line x1="200" y1="200" x2="300" y2="100" stroke="#3b82f6" strokeWidth="2" />
            <line x1="200" y1="200" x2="100" y2="300" stroke="#3b82f6" strokeWidth="2" />
            <line x1="200" y1="200" x2="300" y2="300" stroke="#3b82f6" strokeWidth="2" />
          </svg>
        </div>
      </div>
    </div>
  );
}
